  opacity: .8;
  margin-right: 1rem;
}

.plan__description{
  font-size: 2rem;
  font-weight: 300;
  letter-spacing: 1px;
  display: block;
}

.plan .list__item{
  margin-bottom: 2rem;
  letter-spacing: 1px;
}
.plan--popular{
  transform: scale(1.1);
}

.plan--popular .card__header{
  position: relative;
}
.plan--popular .card__header::before{
  content: url(../images/popular.svg);
  width:40px;
  display: inline-block;
  position: absolute;
  top:-6px;
  right:5%;

}

.plan:hover{
  transform: scale(1.05);
}

.plan--popular:hover {
  transform: scale(1.15);
}

@media screen and (min-width:1024px) {

.plan__name{
  font-size: 1.4rem;
}

.plan__price {
  font-size: 5rem;
}

.plan__billing-cycle {
  font-size: 1.6rem;
}
.plan__description {
  font-size: 1.7rem;
}

}

/*Media Outlet*/

.media{
  display: flex;
  margin-bottom: 4rem;
}

.media__title{
  margin-top: 0;
}

.media__body{
  margin: 0 2rem;
}

.media__image{
  margin-top: 1rem;
}

/*Quotes*/

.quote{
  font-size: 3rem;
  font-style: italic;
  line-height: 1.3;
  color:var(--color-body-darker);
}

.quote__text::before{
  content: open-quote ;
 /* padding-right: 1rem;*/
}

.quote__text::after {
  content: close-quote;
  /*  padding-left: 1rem;*/
}

.quote__author{
  font-size: 3rem;
  font-weight: 600;
  font-style: normal;
  margin-bottom: 0;
}

.quote__company{
  opacity: .4;
  font-size: 2rem;
  font-style: normal;
  color:var(--color-headings);
}

.quote__line{
  position: relative;
  top:-10px;
}

@media screen and (min-width:1024px) {

  .quote__author {
      font-size: 2.4rem;
  }

    .quote__company {
      font-size: 1.6rem;
    }
}

/* Grids*/

.grid{
  display: grid;
}

@media screen and (min-width:768px) {

  .grid--cols-2{
    grid-template-columns: 1fr 1fr;
  }

}

@media screen and (min-width:1068px) {

  .grid--cols-3 {
    grid-template-columns: 1fr 1fr 1fr;
  }

}

/** Testimonials**/

.testimonial{
  padding: 3rem;

}

.testimonial__image {
  position: relative;
 
}

.testimonial__image > img{
  width:100%;
 
}

.testimonial__image > .icon-container {
  position: absolute;
  top:2rem;
  right:-32px;
}

.show-overflow{
  overflow: visible;
}

@media screen and (min-width:768px) {

  .testimonial .quote, .testimonial .quote__author{
    font-size: 2.4rem;
  }

    .testimonial .quote{
      margin-left: 6rem;
    }
}


/** Call out**/

.callout{
  padding:4rem;
  border-radius: 5px;
}

.callout--primary{
  background: var(--color-primary);
  color:#fff;
}

.callout__heading{
  margin-top: 0;
  font-size: 3rem;
  color:#fff;
}

.callout__content{
  text-align: center;
}
.callout .btn{
  justify-self: center;
  align-self: center;
}

@media screen and (min-width:768px) {

.callout .grid--cols-2{
    grid-template-columns: 1fr auto;
  }

 .callout__content{
  text-align: left;
 }
 .callout .btn {
   justify-self: start;
   margin:0 2rem;
 }
}

/**collapsibles**/

.collapsible__header{
  display: flex;
  justify-content: space-between;
}

.collapsible__heading{
  margin-top: 0;
  font-size: 3rem;
}

.collapsible__chevron{
  transform:rotate(-90deg);
  transition: transform .3s;
}

.collapsible__content{
  max-height: 0;
  overflow: hidden;
  transition: all 0.3s;
  opacity: 0;
}

.collapsible--expanded .collapsible__content {
  max-height: 100vh;
  opacity: 1 ;
}

.collapsible--expanded .collapsible__chevron{
  transform: rotate(0);
}

/**Blocks**/
.block{
  --padding-vertical:6rem;
  padding: var(--padding-vertical) 2rem;
  
}

.block__header{
  text-align: center;
  margin-bottom: 4rem;
}
.block__heading{
  margin-top:0;
   
}

.block__dark{
  background: #000;
  color:#7b858b;
 
}

.block__dark h1,.block__dark h2,.block__dark h3{
  color:#fff;
}

.block__skewed-right{
padding-bottom: calc((var(--padding-vertical) + 4rem));
clip-path: polygon(0% 0%, 100% 0%,100% 100%, 0% 90%);

}

.block__skewed-left {
  padding-bottom: calc((var(--padding-vertical) + 4rem));
  clip-path: polygon(0% 0%, 100% 0%, 100% 90%, 0% 100%);

}

/** Container**/

.container{
  max-width: 1140px;
  margin:0 auto;
}

/** Navigation bar**/

.nav__logo{
  width: 50px;
  height: 50px;
}

.nav{
  background: #000;
  display: flex;
  justify-content: space-between;
  flex-wrap: wrap;
  padding: 0 1rem;
  align-items: center;
}

.nav__list{
  width:100%;
  margin: 0;
  
}

.nav__item{
  padding: 0.5rem 2rem;
  border-bottom: 1px solid #222;
 
}

.nav__item > a{
    color: #d2d0db;
    transition: color .03s;
}

.nav__item>a:hover{
  color: #fff;
}

.nav__toggler{
  opacity: .5;
  transition: box-shadow .15s;
  cursor: pointer;

}

.nav.collapsible--expanded .nav__toggler{
  opacity: 1;
  box-shadow: 0 0 0 3px #666;
  border-radius: 5px;
}

.nav__brand{
  transform: translateY(4px);
}
@media screen and (min-width:768px) {
  
  .nav__toggler{
    display: none;
  }

  .nav__list{
    width:auto;
    display: flex;
    font-size: 1.6rem;
    max-height: 100%;
    opacity: 1;
  }

  .nav__item{
    border: 0;
  }
}

/**Hero**/



.hero__tagline{
  font-size: 2rem;
  color:#b9c3cf;
  letter-spacing: 1px;
  margin: 2rem 0 5rem;
}

.hero__image{
  width: 100%;
}

@media screen and (min-width:768px) {
.hero{
  padding-top: 0;
}

  .hero__content{
    text-align: left;
    align-self: center;
  }
}

/*** Domain Block***/

.block-domain .input-group{

  box-shadow: 0 0 30px 20px #e6ebee;
  border: 0;
  margin:4rem auto;
  max-width: 670px;

}

.block-domain__prices{
  display:grid;
  grid-template-columns: repeat(2,1fr);
  grid-template-rows: repeat(2,6rem);
  font-size: 2rem;
  font-weight: 600;
  justify-items: center;
  max-width: 700px;
  margin:0 auto;
  color: var(--color-headings);
}

@media screen and (min-width:768px){
  .block-domain__prices{
    grid-template-columns: repeat(auto-fit, minmax(10rem,1fr));

  }
}

/*Plans Block*/

.block-plans .grid{
  gap: 8rem 4rem;
}

.block-plans .card{
  max-width: 500px;
  margin:0 auto;
}

/** Features**/

.feature__heading{
  margin:1rem 0;
}

.features{
  gap:4rem 2rem;
  margin:12rem 0;
}
.features:first-of-type{
  margin-top: 6rem;
}

@media screen and (min-width:768px) {
 .features:nth-of-type(even) .feature__content{
  order:2;
 }
}

/** Showcase block**/

.block-showcase__image > img{
  width:100%;
}

@media screen and (min-width:768px) {

  .block-showcase .grid{
    grid-template-columns: 50% 50%;
  }
  .block-showcase__image{
   
    justify-self: end;
  }

  .block-showcase__image >img{
    width: auto;
    max-width: 700px;
  }
}

/** Footer**/

.footer{
  background-color: #232323;
}

.footer__heading{
  color:white;
  text-transform: uppercase;
  font-weight: 600;
}


.footer__section {
  padding: 2rem;
  border-bottom: 1px solid #393939;
}

.footer__brand{
  margin-top: 5rem;
  text-align: center;
}

.footer__copyright{
  font-size: 2.1rem;
  color:#fff;
  opacity: .3;
}

.footer a{
  color:#777;
  transition:color .3s;
}

.footer a:hover{
color:white;
}

.footer .list{
  margin:0;
}




@media screen and (min-width:768px) {
  .footer__sections{
    grid-template-columns: repeat(auto-fit,minmax(10rem,1fr));
  }

  .footer .collapsible__chevron{
    display: none;
  }

  .footer .collapsible__content{
    opacity:1;
    max-height: 100%;
  }

  .footer__brand{
    order:-1;
    margin-top: 1rem;
  }

  .footer__copyright{
    font-size: 1.5rem;
  }

  .footer__section{
    border:0;
  }

  .footer__heading{
    font-size: 1.6rem;
  }
}
